export async function addAirportLineData() {
  await addAssets();
}
async function addTrackWithAssets(trackAsset, childAssets, lineId) {
  trackAsset.lineId = lineId;
  trackAsset.parentAsset = lineId;

  if (trackAsset.attributes) trackAsset.attributes = JSON.parse(trackAsset.attributes);

  let t1 = await addLampAsset(trackAsset.unitId, trackAsset);
  let track1Id = t1._id.toHexString();

  for (const a of childAssets) {
    try {
      let a1 = JSON.parse(JSON.stringify(a));
      a1.parentAsset = track1Id;

      if (a1.attributes) a1.attributes = JSON.parse(a1.attributes);

      a1.lineId = lineId;

      await addLampAsset(a1.unitId, a1);
    } catch (err) {
      console.log(
        "Septa-AirportLineData.addTrackWithAssets.catch: track:",
        trackAsset.unitId,
        "asset:",
        a1.unitId,
        "error:",
        err.toString(),
      );
    }
  }
}
async function addTrackWithGenericAssets(trackAsset, genericTrackAssets, lineId, childAssets=[]) {
  trackAsset.lineId = lineId;
  trackAsset.parentAsset = lineId;

  if (trackAsset.attributes) trackAsset.attributes = JSON.parse(trackAsset.attributes);

  let t1 = await addLampAsset(trackAsset.unitId, trackAsset);
  let track1Id = t1._id.toHexString();

  for (const a of genericTrackAssets) {
    try {
      let a1 = JSON.parse(JSON.stringify(a));
      a1.parentAsset = track1Id;

      if (a1.attributes) a1.attributes = JSON.parse(a1.attributes);

      a1.lineId = lineId;

      a1.start = t1.start;
      a1.end = t1.end;
      a1.assetLength = t1.assetLength;
      a1.unitId = a1.unitId + "." + t1.unitId;
      a1.name = a1.name + " " + t1.name;

      await addLampAsset(a1.unitId, a1);
    } catch (err) {
      console.log(
        "Septa-AirportLineData.addTrackWithGenericAssets.catch: track:",
        trackAsset.unitId,
        "asset:",
        a1.unitId,
        "error:",
        err.toString(),
      );
    }
  }
  
    for (const a of childAssets) {
    try {
      let a1 = JSON.parse(JSON.stringify(a));
      a1.parentAsset = track1Id;

      if (a1.attributes) a1.attributes = JSON.parse(a1.attributes);

      a1.lineId = lineId;

      await addLampAsset(a1.unitId, a1);
    } catch (err) {
      console.log(
        "Septa-AirportLineData.addTrackWithGenericAssets.catch: track:",
        trackAsset.unitId,
        "asset:",
        a1.unitId,
        "error:",
        err.toString(),
      );
    }
  }
}

async function addLineAssets(childAssets, lineId) {
  for (const childAsset of childAssets) {
    try {
      let ca = JSON.parse(JSON.stringify(childAsset));
      ca.lineId = lineId;
      ca.parentAsset = lineId;

      if (ca.attributes) ca.attributes = JSON.parse(ca.attributes);

      await addLampAsset(ca.unitId, ca);
    } catch (err) {
      console.log("Septa-AirportLineData.addLineAssets.catch: line:", lineId, "asset:", ca.unitId, "error:", err.toString());
    }
  }
}

async function addAssets() {
  try {
    let location = await AssetModel.findOne({ unitId: "Regional" });

    if (location) {
      lineAsset.parentAsset = location._id;
    }

    let line = await addLampAsset(lineAsset.unitId, lineAsset);

    let lineId = line._id.toHexString();

    await addTrackWithAssets(track1, track1Assets, lineId);
    await addTrackWithAssets(track2, track2Assets, lineId);

    await addTrackWithGenericAssets(singleTrack, genericTrackAssets, lineId, singleTrackAssets);
    await addTrackWithGenericAssets(escapeTrack, genericTrackAssets, lineId);
    await addTrackWithGenericAssets(siding1, genericTrackAssets, lineId);
    await addTrackWithGenericAssets(siding2, genericTrackAssets, lineId);

    await addLineAssets(interlockings, lineId);
    await addLineAssets(bridges, lineId);
    await addLineAssets(crossings, lineId);
    await addLineAssets(stations, lineId);
  } catch (err) {
    console.log("Septa-AirportLine, addAssets, error: ", err.toString());
  }
}
async function addLampAsset(unitId, newAst, createCallback = (err, obj) => {}) {
  let ast = await AssetModel.findOne({ unitId: unitId });
  if (!ast) {
    console.log("adding asset", unitId);
    
    if(typeof newAst.start==="string")
      {
        newAst.start=+(parseFloat(newAst.start).toFixed(2));
      }

      if(newAst.end==="")
      {
        newAst.end=+newAst.start;
        console.log('parsed', newAst.end);
      }

      if(typeof newAst.end==="string")
        newAst.end = +(parseFloat(newAst.end).toFixed(2));

    if(newAst.assetLength==="")
      newAst.assetLength = newAst.end - newAst.start;


    return await AssetModel.create(newAst);
  }
  return ast;
}

